import * as React from "react";
import "./App.css";
import AOS from 'aos'
// Set the theme of the page to default to "light"
import Header from './components/Header'
import Photothingy from './components/Photothingy'

const photoThingData = require('./staticData/photoThingy')


function App() {
  // App component that provides initial context values
  // Here we are overwritting the context to be "dark" using the Provider
  AOS.init()
  return (
    <>
      <Header/>
      <div className="container">
        <div className="row">
          <div className="lg-col-12">
          {photoThingData && photoThingData.map((item, i) => {
            return <Photothingy
              key={i}
              item={item.classname}
              aosAction={item.aosAction}
              captions={item.captions}
            />
          })}
          </div>
        </div>
      </div>
      <div className="bg-image img2">
        <div id="login">
          <div className="container" data-aos="fade-left">


          </div>
        </div>
      </div>
    </>
  )
}


export default App;
